import { Cast } from "../Cast";
import { Random } from "../Random";
export interface IStrategy {
  strategyName: string;
  rate: number;
}
export class Strategy implements IStrategy {
  strategyName: string;
  rate: number;
  constructor(strategyName: string, rate: number) {
    this.strategyName = strategyName;
    this.rate = rate;
  }

  static parse(json: any): Strategy {
    if (json == null) {
      return Strategy.emptyInstance();
    }

    return new Strategy(Cast.string(json.strategyName), Cast.number(json.rate));
  }

  static randomInstance(): Strategy {
    return new Strategy(Random.string(), Random.number());
  }

  static emptyInstance(): Strategy {
    return new Strategy(null, null);
  }

  getStrategyName(): string {
    return this.strategyName;
  }
  setStrategyName($value: string) {
    this.strategyName = $value;
  }

  getRate(): number {
    return this.rate;
  }
  setRate($value: number) {
    this.rate = $value;
  }
}
